import React from 'react'

function Summery() {
  return (
    <div>
      <h2>Upcoming Appointments</h2>
      <ul>
        {appointments.map((appt) => (
          <li key={appt.id}>
            <strong>{appt.title}</strong> - {moment(appt.start).format("LLLL")}
          </li>
        ))}
      </ul>
    </div>
  )
}

export default Summery
